<div class="row  photo-box" style="margin:0;padding-top:0.5rem;">
    <div class="col l2 m2 s12">
        <img 
            style="height:60px !important;width:auto;display:block;margin:0 auto;"
            src="
            data:image/jpeg;base64,
        " alt="" style="height:auto;" class="responsive-img">
    </div>
    <div class="col s10">
        
        <div class=row style=margin:0>

            <div class="col s12" style="height:65px !important;">
                <!-- This is an inline input field: -->
                <div class="input-field inline">
                    <input placeholder="6 digit for collection code..." id="collection_code" type="text" class="input-sku" value="WB63XX" />
                    <label for="collection_code" class="active center-align">SKU (6 หลัก)</label>
                </div>

                <div class="input-field inline panel-padding"></div>

                <div class="input-field inline">
                    
                    <input placeholder="2 digit for color code..." id="color_code" type="text" class="input-color" value="XX" size="2" maxlength="2" />
                    <label for="color_code" class="active center-align">สี (2 หลัก)</label>
                </div>

                <div class="input-field inline panel-padding"></div>
                
                <div class="input-field inline">
                    <input id="vision_code" type="text" class="" value="Front" disabled style="text-decoration:none !important;background:#f0f0f0 !important;" />
                    <label for="vision_code" class="active">(ด้าน : ไม่สามารถแก้ไขได้)</label>
                </div>
            </div>
        </div>
    </div>
</div>